import React from 'react';
import TribenchRow from "./workouts/TribenchRow";
import ShoulderSquatPress from "./workouts/ShoulderSquatPress";

function WorkoutOptions() {
    return (
        <div className="container-fluid">
            <div className="row">
                <div className="col-md-3"><TribenchRow /></div>
                <div className="col-md-3"><ShoulderSquatPress /></div>
            </div>           
        </div>
        
    )
}

export default WorkoutOptions;
